import { HandySvg } from "handy-svg";
import OpenBookIcon from "../../images/images/header/fa-solid_book-open.svg";

export const Header = () => {
  return (
    <header>
      <div>
        <HandySvg src={OpenBookIcon} width="40" height="35" />
        <h1>Finance Ledger</h1>
        <nav>
          <ul>
            <li>
              <a href>Home</a>
            </li>
          </ul>
        </nav>
      </div>
    </header>
  );
};
